import { Link } from 'react-router-dom';
import '../style/Header.css'

function Header() {
  return (
    <header>
      <p id={"logo"}>Logo</p>
      <div id={'right-side'}>
        {/* <Link to={"/"}>Home</Link> */}
      </div>
    </header>
  );
}

export default Header;
